import { Box, Button, Grid, IconButton, Stack, Typography } from '@mui/material'
import React from 'react'
import Sidebar from '../../Component/Sidebar'
import Theme from '../../Component/Theme';
import DensityMediumIcon from '@mui/icons-material/DensityMedium';

const theme=Theme();

export default function Home() {
  return (
    <Grid container display="flex">
      <Grid item flex={2} position="static"
        sx={{backgroundColor:theme.palette.primary.main,height:"100vh"

        }}>
          <Sidebar/>

      </Grid>

      <Grid item flex={10} margin={0}
        sx={{backgroundColor:theme.palette.background.normal,height:"100vh"

        }}>
          <Grid container bgcolor={theme.palette.primary.main} sx={{height:70}} position="static">
            <Grid item xs={6}
              sx={{
                paddingTop:2,
                paddingBottom:2,
                paddingRight:10
              }}
            >
              <IconButton aria-label="delete">
                <DensityMediumIcon sx={{width:100}}/>
              </IconButton>
            </Grid>
            <Grid item xs={6} 
              sx={{
                paddingTop:3,
                paddingBottom:3,
                paddingRight:10
              }}
              textAlign="right">
              <Typography>Home</Typography>
            </Grid>
          </Grid>

      </Grid>

    </Grid>
  )
}
